// src/components/Jumbotron.js
import React from 'react';
import myImage from '../img/my-image.png'; // Adjust the path as necessary

const Jumbotron = () => {
    return (
        <section className="jumbotron shadow-sm text-light" id="jumbotron">
            <div className="container">
                <div className="row d-flex flex-column text-center align-items-center">
                    <div className="col-12">
                        <h1 className="display-4">Hi! I'm Luvky Pratama Johanes</h1>
                        <p className="lead short-abt font-monospace">
                            A Computer Science student at BINUS with a passion for web development.
                        </p>
                    </div>
                    <div className="col-12">
                        <img src={myImage} alt="ME" width="300" className="mt-4" />
                    </div>
                </div>
            </div>
        </section>
    );
};

export default Jumbotron;
